import Header from '../components/Header';

function Home() {
    return (
      <div>
        <Header />
        <main>
          <div>
            <h2> Ademir Ferreira Da Silva Junior </h2>
            <img src="" alt="devmir_icon"></img>
            <p> Brasileiro! vivendo atualmente em: <br/> Almenara, Minas gerais.</p>
          </div>
        </main>
      </div>
    );
  }

  export default Home;
